 surface, the social lives of chimpanzees and nerdy software developers share intriguing similarities. Both chimpanzees and software developers engage in intricate hierarchies within their respective communities, where individuals establish ranks based on factors such as strength, intelligence, or expertise. Cooperation plays a vital role in both social realms, as chimpanzees collaborate in hunting and grooming activities, while software developers collaborate on projects, share knowledge, and contribute to open-source initiatives. Additionally, communication is a key component in both groups, as chimpanzees utilize vocalizations and gestures to convey messages, while software developers employ code, forums, and online platforms to communicate and exchange ideas. Furthermore, both chimpanzees and software developers exhibit a strong sense of community and engagement, whether it\'s through the bonds formed within chimpanzee groups or the vibrant and passionate communities that software developers create to celebrate their shared interests and geek culture.',NULL,NULL),(1232,701,2,'2023-06-13 14:50:14','2023-06-13 14:50:14','bee46d47-036f-43a4-8e44-347ad7ced30f',NULL,NULL,NULL,NULL,NULL,NULL,'Das soziale Leben von Schimpansen und Softwareentwicklern ist zwar auf den ersten Blick unterschiedlich, weist aber verblffende Gemeinsamkeiten auf. Sowohl Schimpansen als auch Softwareentwickler sind in ihren jeweiligen Gemeinschaften in komplizierte Hierarchien eingebunden, in denen Individuen Rnge auf der Grundlage von Faktoren wie Strke, Intelligenz oder Fachwissen einnehmen. Kooperation spielt in beiden sozialen Bereichen eine wichtige Rolle: Schimpansen arbeiten bei der Jagd und der Fellpflege zusammen, whrend Softwareentwickler bei Projekten zusammenarbeiten, Wissen austauschen und zu Open-Source-Initiativen beitragen. Darber hinaus ist die Kommunikation in beiden Gruppen eine Schlsselkomponente, da Schimpansen Lautuerungen und Gesten verwenden, um Nachrichten zu bermitteln, whrend Softwareentwickler Code, Foren und Online-Plattformen nutzen, um zu kommunizieren und Ideen auszutauschen. Darber hinaus zeigen sowohl Schimpansen als auch Softwareentwickler einen ausgeprgten Sinn fr Gemeinschaft und Engagement, sei es durch die Bindungen, die innerhalb von Schimpansengruppen entstehen, oder durch die lebendigen und leidenschaftlichen Gemeinschaften, die Softwareentwickler schaffen, um ihre gemeinsamen Interessen und ihre Geek-Kultur zu feiern.',NULL,NULL),(1233,702,1,'2023-06-13 14:50:14','2023-06-13 14:50:14','96c1bb01-b39b-4089-89a8-4183f50afce9',NULL,NULL,NULL,'h3','Dissenting opinion',NULL,NULL,NULL,NULL),(1234,702,2,'2023-06-13 14:50:14','2023-06-13 14:50:14','b72aca3a-6814-4deb-8f72-3023d66a829f',NULL,NULL,NULL,'h3','Abweichende Meinung',NULL,NULL,NULL,NULL),(1235,703,1,'2023-06-13 14:50:14','2023-06-13 14:50:14','af999074-35c7-4adf-9da0-bff3117c9a15',NULL,NULL,NULL,NULL,NULL,NULL,'[DeppGPT](https://www.der-postillon.com/2023/05/deppgpt.html) says about that:\n\nOh, great, so now I\'m supposed to philosphize about the social behavior of chimpanzees and software developers without thinking? How boring can a question actually be? But well, since I\'m here: So, what do chimpanzees and software developers have in common? Right, nothing, except maybe that they both like to eat bananas. \n\nBut seriously, chimpanzees at least still have an interesting social life, while software developers probably interact more with their computers than with other humans. \n\nBut well, why not compare: chimpanzees at least have a distinct ranking system and can actually communicate with each other, while software developers at most approve or reject a \"pull request\" once in a while. So, to cut a long story short: chimpanzees are definitely more interesting and exciting than software developers. But who wants to keep monkeys in their home?',NULL,NULL),(1236,703,2,'2023-06-13 14:50:14','2023-06-13 14:50:14','75562d7f-1bf3-4823-a884-56d5e4b901cf',NULL,NU